import React from 'react';
import contentStyles from './Content.module.css';


function Gallery() {
  return (
        <div className={contentStyles.gallery}>
            <h2>My skills</h2>
            <div className={contentStyles.galleryWrapper}>
                <img src="../../img/html.png" alt="" className="htmlImg"/>
                <img src="../../img/js.png" alt="" className="jsImg"/>
                <img src="../../img/css.png" alt="" className="cssImg"/>
                <img src="../../img/react.png" alt="" className="reactImg"/>
            </div>

        </div>

  );
}

export default Gallery;
